import ImageMacBook from "./og-macbook-pro-202301.jpg";
import ImageMacBook2 from "./intro__ewz1ro7xs14y_large.jpg";
import iPhoneImage from "./iphone-14-pro-finish-unselect-gallery-1-202209_GEO_EMEA.jpg";
import ImageAirpods from "./Apple-AirPods-Pro-2nd-gen-hero-220907_big.jpg.large.jpg";
import ImageAirpods2 from "./wp4823412.png";
import ImageIPad from "./Apple-iPad-10th-gen-hero-221018.jpg.og.jpg";
import ImageIphone from "./daac540d-cel1351-p.jpg";
import ImageCartLoading from "./shopping-cart-loading.gif";

export const Images = [
  {
    ImageMacBook: ImageMacBook,
    ImageMacBook2: ImageMacBook2,
    iPhoneImage : iPhoneImage,
    ImageAirpods : ImageAirpods,
    ImageAirpods2 : ImageAirpods2,
    ImageIPad : ImageIPad,
    ImageIphone : ImageIphone,
    ImageCartLoading : ImageCartLoading
  }
];
